                'title' => '{"fr":"Ateliers culinaires","en":"Culinary workshops","ar":"ورش عمل الطهي"}',
                'description' => '{"fr":" Nous avons le plaisir de vous présenter notre atelier  culinaire d\'exception, animé par un chef renommé  et en présence de nos partenaires médiatiques. Cet  événement unique est une opportunité idéale pour  dé- couvrir en action les produits phares de notre  salon. À travers des démonstrations en direct dans  une cuisine équipée, des astuces de professionnels  et des dégustations exclusives, nous mettrons en  lumière la performance l’innovation et l’ergonomie  des équipements. Rejoignez-nous pour vivre une  expérience immersive où la gastronomie rencontre  la technologie. Laissez-vous inspirer pour sublimer  vos espaces de cuisine avec des solutions alliant  design et fonctionnalité. Ne manquez pas ce  moment privilégié, où saveurs, expertise et  excellence se rencontrent pour une démonstration  inoubliable !","en":"We are pleased to present our exceptional culinary workshop, led by a renowned chef and attended by our media partners. This unique event is an ideal opportunity to discover our show\'s flagship products in action. Through live demonstrations in a fully equipped kitchen, professional tips, and exclusive tastings, we will highlight the performance, innovation, and ergonomics of our equipment. Join us for an immersive experience where gastronomy meets technology. Let yourself be inspired to enhance your kitchen spaces with solutions that combine design and functionality. Don\'t miss this special moment, where flavors, expertise, and excellence come together for an unforgettable demonstration!","ar":"يسعدنا أن نقدم لكم ورشة العمل الخاصة بنا. تجربة طهي استثنائية، يقدمها طاهٍ مشهور وبحضور شركائنا الإعلاميين. هذا الحدث الفريد هو فرصة مثالية لـ اكتشف منتجاتنا الرائدة أثناء العمل غرفة الجلوس. من خلال العروض الحية في مطبخ مجهز، نصائح احترافية وتذوق حصري، سنضعه في الابتكار في أداء الضوء وبيئة العمل معدات. انضم إلينا لتجربة تجربة غامرة حيث يلتقي فن الطهي تكنولوجيا. اسمح لنفسك أن تستلهم لتعزيز مساحات مطبخك مع حلول تجمع بين التصميم والوظيفة. لا تفوت هذا لحظة خاصة، حيث النكهات والخبرة و لقاء التميز للتظاهرة لا ينسى!"}',
